import React, { Component } from 'react';

export default class Contacts extends Component{
    constructor(props){
        super(props);

        this.deleteAbout = this.deleteAbout.bind(this)

        this.state = {About: []};
    }

    componentDidMount(){
        axios.post('http://localhost:5001/about/')
        .then(response =>{

            this.setState({About: response.data})
        })
        .catch((error) => {
            console.log
        })
    }



render(){
    return(
        <div>
             <p>
             You are in the About 
            </p>
        </div>
    )}
}
